import logo from '../../assets/images/logo.PNG';
import ProfileImage from './ProfileImage';
import Bell from './Bell';

const NavBar = ({ children }) => {
    return (
        <header id="nav-bar">
            <img id="logo" src={logo}></img>
            <Bell/>
            <ProfileImage/>
        </header>
    )
}

export default NavBar;
